import Tiles from "../ui-design/Tiles";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

function Home() {

    var slickSliderSettings = {
        dots: false,
        infinite: true,
        slidesToShow: 3,
        slidesToScroll: 1,
        autoplay: true,
        speed: 30000,
        autoplaySpeed: 0.0001,
        cssEase: "linear",
        variableWidth: false
    };

    return (
        <div className="Home">
            Home
            <div>
                <Slider className="slider-container" {...slickSliderSettings}>
                    <div>
                        <Tiles></Tiles>
                    </div>
                    <div>
                        <Tiles></Tiles>
                    </div>
                    <div>
                        <Tiles></Tiles>
                    </div>
                    <div>
                        <Tiles></Tiles>
                    </div>
                </Slider>
            </div>
        </div>
    );
}

export default Home;
